  \"2015-11-25T17:35:28.293090\",\n\t\"name\": \"gpm-dpr-level-3-dpr-daily-v03\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The precipitation estimates in the 3DPRD
  product are a subset of those in the full daily 3DPR product; the retrieval estimates
  are the same. Since this is a subset, the product is smaller, and Level 3 DPR products
  present the user with summary information over daily and monthly time periods. These
  gridded products are in a convenient gridded form and can be used easily in comparisons
  with other satellite and ground data.ntntABSTRACTThe Level 3 DPR joint algorithm
  subsets precipitation estimates from the Level 3 daily products. In addition, it
  adds time information from Level 2 instantaneous data to give a date/time for the
  last measurement in each grid box. The product contains one 0.25 x 0.25 degree grid
  with separate indices for the ascending and descending parts of the GPM orbit.\",\n\t\"license_title\":
